import React, { Component } from 'react'

import Army from './withArm';

class Rahul extends Component {
   
    render() {
        console.log(this.props.camp)
        return (
            <div>
            <h1>Camp: {this.props.camp}</h1>
                <h2 onMouseOver = {this.props.hochandleShots}>Rahul {this.props.hocgunname} Gunshots: {this.props.hocgunshots}</h2>
            </div>
        )
    }
}


export default Army(Rahul, 10);
